import data from "./data";

function Display({item}

    )
    {

return (
    <div>
        <div>{item.name}</div>
        <div>{item.price}</div>
        <div>{item.pictures}</div>
        <div>{item.seller.name}</div>
        <div>{item.seller.firstName}</div> 
        <div>{item.seller.phoneNumber}</div> 
        <div>{item.seller.address}</div> 
        <div>{item.location.city}</div>
        <div>{item.location.country}</div> 
        <div>{item.location.street}</div> 
        <div>{item.location.zipCode}</div>
        <div>{item.rate}</div>
        {
            data.map(x => <Seller item={x}/>)
        }
    </div>
    
    )
}


export default Display;
